var roll;
var sem;
var Semesters = ['I','II','III','IV','V','VI'];
function GetRes(){
			document.getElementById("result-content").innerHTML = " ";
			document.getElementById("chartContainer").innerHTML = " ";
			document.getElementById("chartContainer1").innerHTML = " ";
			document.getElementById("analytics").innerHTML = " ";
        roll = document.getElementById("roll").value.toUpperCase();
        sem = document.getElementById("sem").value;
        var sem_id = Semesters.indexOf(sem);
        if(roll.length<10 || roll.length>10)
        {
          var msg = "<span id='error'>INVALID USERNAME</span>"; 
          document.getElementById("result-content").innerHTML = msg; 
          return;
        }
        var points = GetResult(roll,sem_id);
        if(points!=undefined){
          var per = parseFloat(points[1])*9.5;
          var msg = "<span id='result'>SGPA : "+points[0]+"</span><span id='result'>CGPA : "+points[1]+"</span><span id ='result'>% : "+Math.round(per)+"</span>";
          document.getElementById("result-content").innerHTML = msg;
          var msg11 =  "<input type='button' value='My Analytics' onclick='chart()'>"
  	 	  document.getElementById("analytics").innerHTML = msg11;
        }
        else
        {
          var msg = "<span id='error'>SORRY CAN'T FIND YOUR RESULTS</span>"; 
          document.getElementById("result-content").innerHTML = msg;

        }
}
function GetResult(roll,sem_id) {
  var data1 = Data[roll];
  if(data1==undefined)
  	return undefined;
  console.log(data1)
  if(data1[sem_id]) return data1[sem_id];
  return undefined;
}

function points()
{
	cgpa = [];
	sgpa = [];
	var data1 = Data[roll];
	var leng = data1.length;
	for(i=0;i<leng;i++){
		cgpa.push(parseFloat(data1[i][0]));
		sgpa.push(parseFloat(data1[i][1]));
	}

	cgpa_data = [];
	sgpa_data = [];
	for(i=0;i<leng;i++){
		cgpa_data.push({x:i+1,y:cgpa[i]});
		sgpa_data.push({x:i+1,y:sgpa[i]});
	}
	return [cgpa_data,sgpa_data];
}

